function Menu(){
    return (
    <p>
    Menu:
    <ul>
    <li><a href="/profile">Profile</a></li>
    <li><a href="/proyek">Produk</a>
    <ul>
    <li><a href="/proyek/mobile-app">Pemesanan</a></li>
    </ul>
    </li>
    </ul>
    </p>
    );
   }
   export default () => (
    <div>
    <h1>Galeri Produk</h1>
    <p>Galeri Produk berisi semua produk yang tersedia</p>
    <hr />
    <Menu />
    </div>
   )
